sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  	var obj = new x_snc_plants_db.Weather();
  	var data = obj.get(inputs.latitude.toString(), inputs.longitude.toString());

  	// Check if there is rain based on wxPhraseLong
	if (data.wxPhraseLong && data.wxPhraseLong.toLowerCase().includes("rain")) {
	  outputs.status = true;
	} else {
	  outputs.status = false
	}

  	outputs.temperature = data.temperature;
})(inputs, outputs);

